import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <form action="">
        <label>
          Cart Value:
          <input type="text" name="cart-value" />
        </label>
        <label>
          Delivery distance
          <input type="text" name="delivery-distance" />
        </label>
      </form>
    </div>
  );
}

export default App;
